In a pattern, every literal value can also be replaced with an ignore directive or a binding. The ignore directive looks like an underscore _, which tells rune to ignore the value, allowing it to have any value. fn test_ignore(vector) { match vector { [_, 42] => dbg("second item in vector is 42"), }
} In contrast to ignoring, we cal also bind the value to a variable: fn test_bind(vector) { match vector { [_, b] => dbg(`second item in vector is {b}`), }
} Here are some more examples: [_, a, b] which will ignore the first, but then capture the second and third element in the vector. {"name": name} will capture the name value out of the specified object. Finally we can also add the sequence .. to ask Rune to ignore any additional values in a collection that might be present when matching a vector or an object. /// Describe how fast the first car in the vector is.
fn first_car_speed(cars) { match cars { [first, ..] => match first { {"model": "Ford", "make": 2000, ..} => "Pretty fast", {"model": "Ford", "make": 1908, ..} => "Could be faster", _ => "Unknown", }, _ => "You didn't give me a vector of cars!", }
}

