The return keyword allows for returning from the current function. If specified without an argument, the function will return a unit (). The last statement in a function is known as an implicit return , and will be what the function returns by default unless a return is specified. fn foo(n) { if n < 1 { return "less than one"; } "something else"
} fn main() { dbg(foo(0)); // => outputs: "less than one" dbg(foo(10)); // => outputs: "something else"
}

