If expressions allow you to provide a condition with one or more code branches. If the condition is true, the provided block of code will run. fn main() { let number = 3; if number < 5 { dbg("the number is smaller than 5"); }
} Optionally, we can add another branch under else, which will execute in case the condition is false. fn main() { let number = 3; if number < 5 { dbg("the number is smaller than 5"); } else { dbg("the number is 5 or bigger"); }
} We can also add an arbitrary number of else if branches, which allow us to specify many different conditions. fn main() { let number = 3; if number < 5 { dbg("the number is smaller than 5"); } else if number == 5 { dbg("the number is exactly 5"); } else { dbg("the number is bigger than 5"); }
} Do note however that if you have many conditions, it might be cleaner to use a match. This will be covered in a later section, but here is a sneak peek: fn main() { let number = 3; match number { n if n < 5 => { dbg("the number is smaller than 5"); } 5 => { dbg("the number is exactly 5"); } n => { dbg("the number is bigger than 5"); } }
}

