The loop keywords builds the most fundamental form of loop in Rune. One that repeats unconditionally forever, until it is exited using another control flow operator like a break or a return. fn main() { loop { dbg("Hello forever!"); }
} When broken out of, loops produce the value provided as an argument to the break keyword. By default, this is simply a unit (). fn main() { let counter = 0; let total = loop { counter = counter + 1; if counter > 10 { break counter; } }; dbg("The final count is: " + total);
}
